import './App.css';
import Home from './Component/Home/Home';
import Navbar from './Component/Navbar/Navbar';

function App() {
  return (
    <>
     <Navbar/>
     <Routes>
     <Route path='home' element={<Home/>}/>
     <Route path='home' element={<Home/>}/>
     </Routes>
    </>
  );
}

export default App;
